import { StyleSheet } from "react-native";

const styles = StyleSheet.create({

    container: {

      flex:1,
    },   

    containerh:{
        width:'100%',
        height:'5%',
        backgroundColor:'#01CCAA',


    },
    titulo:{

        fontSize:30,

    },
    prompt:{

        width:'100%',
        height:'90%',
        backgroundColor: '#fff',

        padding:'7%',

    },

    containerf:{
        width:'100%',
        height:'5%',
        backgroundColor:'#01CCAA',
        
    },
});

  export default styles;
